        "name": "Dr. Emilia Roig",
        "descriptionDe": "Emilia Roig (sie/ihr) ist die Gründerin und Geschäftsführerin des in Berlin ansässigen Center for Intersectional Justice (CIJ), einer gemeinnützigen Organisation, die sich für Gerechtigkeit, Gleichberechtigung und ein Leben frei von systemischer Unterdrückung für alle einsetzt. Ihre Erfahrung, in einer algerisch-jüdisch-karibischen Familie in Frankreich aufzuwachsen, prägte ihr Engagement und ihre Leidenschaft für intersektionale soziale Gerechtigkeit. Seit 2020 lehrt sie an der Hertie School in Berlin, von 2015 bis 2020 war sie Faculty Member des Social Justice Study Abroad Program der DePaul University of Chicago und hat an Universitäten in Frankreich, Deutschland und den U.S.A. zu Intersektionalitätstheorie, Postcolonial Studies, Critical Race Theory, Queer Feminism und Internationalem und Europäischem Recht unterrichtet. Sie hat in Politikwissenschaft promoviert, und hat einen Master of Public Policy und einen MBA in internationalem Recht. Vor ihrer Promotion arbeitete sie intensiv zu Menschenrechtsfragen bei der UN in Tansania und Uganda, bei der Deutschen Gesellschaft für Internationale Zusammenarbeit (GIZ) in Kambodscha und bei Amnesty International in Deutschland - und entschied sich, den Bereich der Entwicklungszusammenarbeit zu verlassen, um sich auf soziale Gerechtigkeit in Europa zu konzentrieren. Sie war Jurymitglied des Deutschen Sachbuchpreises 2020, wurde 2020 zum Ashoka Fellow ernannt und erhielt 2021 den Edition F Award \"Wege aus der Krise\" in der Kategorie \"Gesellschaft\". Emilia widmet sich der Aufgabe, Menschen zu inspirieren, sich von Unterdrückungssystemen zu lösen, neue Narrative zu schaffen und das kollektive Bewusstsein zu verändern. Sie ist die Autorin des Bestsellers WHY WE MATTER. Das Ende der Unterdrückung.  ",
        "descriptionEn": "Emilia Roig (she/her) is the founder and CEO of the Berlin-based Center Intersectional Justice (CIJ), a non-profit organization whose mission it is to make anti-discrimination and equality policy more inclusive and effective in Europe. Since 2020, she has taught at the Hertie School in Berlin, from 2015 to 2020 she was a faculty member of the Social Justice Study Abroad Program of DePaul University of Chicago. In addition, she has taught intersectionality theory, Postcolonial Studies, Critical Race Theory, Queer Feminism und International and European Law at universities in France, Germany and the USA. Emilia primary aim is to inspire others, eliminate systems of oppression, form new narratives and to change our collective consciousness. She is also the author of the best-seller WHY WE MATTER. The End of Oppression.  ",
