        "name": "Kristina Lunz",
        "descriptionDe": "​​Kristina Lunz ist Mitbegründerin und Mit-Geschäftsführerin des Centre for Feminist Foreign Policy (CFFP). Zwischen Januar 2019 und Januar 2020  war Kristina externe Beraterin im Auswärtigen Amt, wo sie das feministische Netzwerk Unidas für Bundesaußenminister Maas mit aufbaute. Davor war sie  als Gender und Coordination Officer des Entwicklungsprogramms der Vereinten Nationen (United Nations Development Programme, UNDP) in Yangon, Myanmar, sowie bei der lokalen NGO Sisma Mujer in Bogotá, Kolumbien, wo sie diese zu 'Frauen, Frieden und Sicherheit' (Women, Peace and Security, WPS) unterstützte. Sie studierte u.a. am University College London (MSc Global Governance and Ethics) und an der University of Oxford (MSc Global Governance and Diplomacy). Am 24.02.2022 erschien ihr Buch “Die Zukunft der Aussenpolitik ist feministisch“ (Ullstein/Econ Verlag). ",
        "descriptionEn": "​​Kristina Lunz is co-founder and co-CEO at the Centre for Feminist Foreign Policy (CFFP). Between January 2019 and January 2020, Kristina was active as an advisor at the Federal Foreign Office of Germany, where she helped establish the feminist network Unidas German Foreign Minister Heiko Maas. Previously, she was the Gender and Coordination Officer at the United Nations Development Programme (UNDP) in Yangon, Myanmar, and also active at Sisma Mujer, an NGO in Bogotá, Colombia. She studied at the University College London and University of Oxford. IN February 2022, she published her first book “Die Zukunft der Aussenpolitik ist feministisch.” ",
