        "name": "Jenni Baum-Minkus",
        "descriptionDe": "Jenni Baum-Minkus ist Gründerin & Managing Director von gitti conscious beauty, ein Start up mit der Mission die Beauty Industrie zu revolutionieren mit innovativen, natürlichen, veganen und cleanen Produktlösungen. Mit gitti schafft die Wahl-Berlinerin nicht nur Aufklärung und Wertschätzung für den bewussten Umgang mit Kosmetikprodukten, sondern macht außerdem in dem eigenen Online-Magazine the good good Raum für alle Themen rund um einen bewussten, authentischen Lifestyle. Nach dem Jenni ihre Konzern Karriere beendete und eine Ausbildung zur Yogalehrerin absolvierte, fand sie den Weg in die Gründung, nach dem sie feststellte, wie schädlich herkömmliche Nagellacke für den Menschen sein können. Das erste Produkt zum Launch war eine Nagelfarbe, die zu 55% auf Wasser basierend ist und dabei ist gitti vegan, geruchsneutral und auch umweltfreundlich. Nach zwei Jahren umfasst das Sortiment über 100 wasser- und pflanzenbasierte Nagelfarben, sowie Nagel- und Handpflegeprodukte. Für und gemeinsam mit der stetig wachsenden gitti-Community werden Produkte entwickelt, die gut für den Menschen, für den Planeten und für die Gesellschaft sind. 2018 erhielt Jenni den Digital Female Leader Award in der Kategorie Lifestyle, 2020 war sie bei  “Junge Elite - die Top 40 unter 40” der Zeitschrift Capital gelistet, sowie auf unter den “100 Macher, Gründer, Kreative” des Business Punk Magazins.",
