        "name": "Tobias Seikel",
        "descriptionDe": "Tobias Seikel ist ein Investmentprofi mit umfangreicher Erfahrung im Bereich Venture Capital und dem Aufbau von Start-ups in der DACH-Region. Er ist Mitgründer und General Partner von Planet A und überzeugt, dass es unerlässlich ist, den Klimawandel und andere Umweltprobleme unserer Zeit anzugehen. Neben seiner Tätigkeit bei Planet A ist Tobias regelmäßig als Mentor tätig und unterstützt verschiedene Unternehmen bei ihren Weiterbildungsprogrammen, wie z.B. Google (Juror), HMS Hamburg Media School (Dozent) und Next Media Accelerator (Mentor). Darüber hinaus engagiert er sich als Business Angel in verschiedenen Startups und als Referent auf Branchenveranstaltungen.",
