        "name": "Ralf Dümmel",
        "descriptionDe": "Seine Karriere bei DS Produkte begann vor über dreißig Jahren, 1988, als Verkaufsassistent des Geschäftsführers und Gründers Dieter Schwarz. Bereits ein Jahr später übernahm der gelernte Einzelhandelskaufmann die komplette Verantwortung für den Ein- und Verkauf. Er baute die DS Gruppe als Geschäftsführer maßgeblich mit auf. Unter seiner Leitung entwickelte sich das Unternehmen mit dem Hauptsitz in Stapelfeld bei Hamburg und dem Logistikzentrum in Gallin in Mecklenburg-Vorpommern mit Marken wie LANDMANN, dem ältesten deutschen Grillhersteller, zu einem der erfolgreichsten deutschen Handelshäuser. Im Jahr 2021 fusionierte die DS Unternehmensgruppe mit der im Prime Standard der Börse Frankfurt notierten The Social Chain AG. Ralf Dümmel ist Großaktionär und rückte als Chief Product Officer (CPO) in den Vorstand. Seit 2016  ist Ralf Dümmel Investor in der VOX Gründer-Show „Die Höhle der Löwen“. Der Vater von drei Kindern lebt mit seiner Freundin Anna Heesch in Hamburg, ist großer Fußballfan und liebt gutes Essen.",
