        "name": "Lana Wittig",
        "descriptionDe": "Lana Wittig ist seit Januar 2021 als Geschäftsführerin für das Medienunternehmen EDITION F verantwortlich und verfolgt die bekannte Mission von EDITION F weiter: modernen Feminismus auf die Agenda setzen und den Wandel hin zur Gleichberechtigung aktiv mitgestalten. Die gebürtige Berlinerin startete ihre Karriere in der Musikbranche und war seit 2006 unter anderem für das Künstler*innen-Management und Musikmarketing bei Motor Entertainment, LaserLaser und Chimperator zuständig. Seit 2016 ist sie Teil des Teams von EDITION F.  Lana Wittig bietet gemeinsam mit ihrem 15-köpfigen Team Frauen in Politik, Wirtschaft und Gesellschaft eine Bühne und stärkt so die Medienpräsenz von Frauen in Deutschland. EDITION F bietet mit redaktionellem Content, regelmäßigen Live-, Video- sowie Audioformaten, einer großen Community und einem diversen Netzwerk der Zielgruppe ein digitales Zuhause. Darüber hinaus ist es ihr wichtigstes Anliegen, undogmatischen, intersektionalen Feminismus und die damit verbundenen Themen in den Köpfen zu verankern und zwar für alle Geschlechter: Denn nur so kann Gleichberechtigung entstehen. Die EDITION F Geschäftsführerin spricht regelmäßig bei Konferenzen zu den Themen Diversity und Employer Branding und ist seit 2019 bei EDITION F Gastgeberin des Podcasts „Alles Anders”, in dem sie mit den spannendsten Köpfen aus der Wirtschaft darüber spricht, wie wir unsere Arbeitswelt gerecht, divers und inklusiv neu denken können. In der Leadership Funktion bei EDITION F überblickt die 36-Jährige die Geschicke des Unternehmens und fördert und fordert die Teammitglieder*innen indem sie nicht nur Chefin ist, sondern auch Vertraute. ",
