        "name": "Franziska Gärtner",
        "descriptionDe": "Franziska Gärtner ist Expertin für feministisches Marketing, CMO beim Berliner Medienunternehmen EDITION F und lebt mit ihrem Mann in Berlin-Prenzlauer Berg. Die 36-jährige sagt, dass feministisches Marketing kein Trend und kein simples Marketing-Instrument sein sollte, sondern eine Notwendigkeit. Dafür arbeitet sie jeden Tag und lebt die Werte und Themen von EDITION F. Franziska Gärtner ist seit 2016 bei EDITION F und verantwortlich für die Bereiche Marketing, PR, Events und Merchandise. Weitere wichtige Themen bei denen Franziska unterstützen kann, sind “Marketing ohne Budget”, vor allem Start Ups und kleine Unternehmen sind hier die Zielgruppe und “Aufbau einer Community”. Die Kommunikation kann ruhig laut sein, findet sie! In ihrer Rolle als CMO ist Franziska selbst eine Unternehmerin im Unternehmen und hat wie ein Schweizer Taschenmesser viele Lösungen parat. Bei der Führung ihres Teams sind ihr emotionale Intelligenz und Empathie besonders wichtig und sie will Mut machen und auch selbst mutiger sein. Weitere Fokusthemen, die ihr sehr am Herzen liegen und für die sich tagtäglich einsetzt, sind Diversität, Nachhaltigkeit und Gleichstellung. ",
