        "name": "Alexandra Großkurth (& Birgit Ahlers)",
        "descriptionDe": "Alexandra und Birgit sind frühe Google Pionierinnen des Hamburger Standorts und bringen gemeinsam über 30 Jahre Google-Erfahrung in unterschiedlichen Vertriebsbereichen mit. Ihr Job Share-Tandem „AliBi“ haben beide 2018 mit ihrem Wechsel in Googles globales Partnerschaften-Team gegründet. Dort verantworten sie gemeinsam Umwelt- und Nachhaltigkeitsthemen mit dem Fokus auf strategische Partnerschaftsentwicklung in Europa.  Unter AliBi’s Leitung entstand u.a. das Projekt „Air View“, ein Projekt zur lokalen Messung der Luftqualität in Hamburg, das im Herbst 2021 in Kooperation mit der HafenCity Universität (HCU) und der Stadt Hamburg gestartet wurde.",
